import react from "react";

const PokemonMoves = (props) => {
  let moves = props.stats.moves;
  console.log("moves", moves);
  console.log(moves.move[1]);
  let moveNames = [];

  for (let i = 0; i < moves.length; i++) {
    let name = moves[i].move.name;
    console.log(name);
    moveNames.push(name);
  }

  console.log("names", moveNames);

  return <h1>Moves</h1>;
};

export default PokemonMoves;
